/// <summary>
///    Enables and disables fields for when this form is called from InventTrackingDimTracing form.
/// </summary>
/// <remarks>
///    This is specific to inventory tracing.
/// </remarks>
private void disableEnableControlsForItemTracing()
{
    //enable vendor related fields
    PurchLine_VendAccount.visible(true);
    InventBatch_PdsVendBatchId.visible(true);
    editContactPersonName.visible(true);
    ContactPersonPhone.visible(true);

    //enable fields related to quantity
    PurchLineGrid_RemainPurchPhysical.visible(true);
    PurchLineGrid_PdsCWRemainInventPhysical.visible(true);
    PurchLineGrid_RemainPurchFinancial.visible(true);
    PurchLineGrid_PdsCWRemainInventFinancial.visible(true);

    //enable purchase line status
    PurchLine_PurchStatus.visible(true);
    PurchTable_ReturnItemNum.visible(true);
    PurchLine_ConfirmedDlv.visible(true);
    PurchLine_InterCompanyOriginDisplay.visible(true);

    //disable procurement category
    PurchLine_ProcurementCategory.visible(false);

    //disable price related fields except for net amount
    PurchLine_PurchPrice.visible(false);
    PurchLine_LineDisc.visible(false);
    PurchLine_LinePercent.visible(false);
}

public Common docCursor()
{
    Common docCursor;

    docCursor = super();

    if (docCursor.TableId == tableNum(InventDim))
    {
        docCursor = purchLine;
    }

    return docCursor;
}

public void  init()
{
    traceFilter = element.args().parmObject() as InventTrackingPurchaseSummaryFilter;
    if (traceFilter)
    {
        traceFilter.parmFormRun(this);
    }

    super();

    if (element.args().parmEnum())
    {
        showProject = true;

        // Initialization specifically for projects
        if (! element.args().record()) // called from menu
            purchLine_ds.query().dataSourceTable(tableNum(PurchLine)).addRange(fieldNum(PurchLine, ProjId)).value(SysQuery::valueNotEmptyString());
    }

    if (traceFilter)
    {
        //Initialization specifically for item tracing
        traceFilter.formInitPost();
        this.disableEnableControlsForItemTracing();
    }

    element.updateDesign(InventDimFormDesignUpdate::Init);

    if (isConfigurationkeyEnabled(configurationKeyNum(PublicSector))
            && !(isConfigurationkeyEnabled(configurationKeyNum(Tax1099G)) || isConfigurationkeyEnabled(configurationKeyNum(Tax1099S))))
    {
        // Hide the 1099 tab if 1099G and 1099S are disabled
        tabLineTax1099.visible(false);
    }

    // <GTE>
    if (TaxIntegrationUtils::isTaxInformationEnabled())
    {
        TransTaxInformation.visible(true);
    }
    // </GTE>
}

Object inventDimSetupObject()
{
    return inventDimFormSetup;
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    InventMovement movement = InventMovement::construct(purchLine);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (!inventDimFormSetup)
                inventDimFormSetup  = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);

        case InventDimFormDesignUpdate::Active      :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(),movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(),movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default : throw error(strfmt("@SYS54195",funcname()));
    }
    purchLine_ProjId.visible(showProject);
    purchLine_ProjCategoryId.visible(showProject);
}

int  active()
{
    int  ret;

    ret = super();

    element.updateDesign(InventDimFormDesignUpdate::Active);

    return ret;
}

void  linkActive()
{
    PurchAgreementHeader    purchAgreementHeader;
    AgreementLine           agreementLine;
    QueryBuildDataSource    queryBuildDataSource;

    boolean                 ret = false;
    str                     projIdStr;

    ProjInvoiceTable        projInvoiceTable;
    ProjTable               projTable, tmpProjTable;
    ProjWIPTable            projWIPTable;

    switch (element.args().dataset())
    {
        case tableNum(ProjInvoiceTable) :   projInvoiceTable   =   element.args().record();

                                            queryBuildDataSource = this.query().dataSourceTable(tableNum(PurchLine));
                                            queryBuildDataSource.clearRanges();

                                            while select ProjId from projTable
                                                where projTable.ProjInvoiceProjId   == projInvoiceTable.ProjInvoiceProjId
                                            {
                                                ret = true;
                                                queryBuildDataSource.addRange(fieldNum(PurchLine,ProjId)).value(projTable.ProjId);
                                            }

                                            if (!ret)
                                            {
                                                queryBuildDataSource.addRange(fieldNum(PurchLine, ProjId)).value(SysQuery::valueNotEmptyString());
                                            }
                                            break;

        case tableNum(ProjWIPTable)     :   projWIPTable   =   element.args().record();

                                            queryBuildDataSource = this.query().dataSourceTable(tableNum(PurchLine));
                                            queryBuildDataSource.clearRanges();

                                            while select ProjId from projTable
                                                where projTable.wipProject  == projWIPTable.ProjId
                                            {
                                                ret = true;
                                                queryBuildDataSource.addRange(fieldNum(PurchLine,ProjId)).value(projTable.ProjId);
                                            }

                                            if (ret == false)
                                            {
                                                queryBuildDataSource.addRange(fieldNum(PurchLine, ProjId)).value(SysQuery::valueNotEmptyString());
                                            }
                                            break;

        case tableNum(ProjTable)            :  tmpProjTable   =   element.args().record();

                                            queryBuildDataSource = this.query().dataSourceTable(tableNum(PurchLine));
                                            queryBuildDataSource.clearRanges();

                                            projIdStr = tmpProjTable.ProjId;
                                            projIdStr += ('*');

                                            queryBuildDataSource.addRange(fieldNum(PurchLine,ProjId)).value(projIdStr);

                                            break;

        case tableNum(PurchAgreementHeader): purchAgreementHeader = element.args().record();
                                            queryBuildDataSource = this.query().dataSourceTable(tableNum(PurchLine));
                                            queryBuildDataSource.clearRanges();
                                            queryBuildDataSource = queryBuildDataSource.addDataSource(tableNum(AgreementLineReleasedLine));
                                            queryBuildDataSource.joinMode(JoinMode::ExistsJoin);
                                            queryBuildDataSource.addLink(fieldNum(PurchLine, InventTransId),
                                                                         fieldNum(AgreementLineReleasedLine, PurchLineInventTransId));

                                            queryBuildDataSource = queryBuildDataSource.addDataSource(tableNum(AgreementLine));
                                            queryBuildDataSource.joinMode(JoinMode::ExistsJoin);
                                            queryBuildDataSource.addLink(fieldNum(AgreementLineReleasedLine, AgreementLine),
                                                                         fieldNum(AgreementLine, RecId));
                                            queryBuildDataSource.clearDynalinks();
                                            queryBuildDataSource.relations(true);
                                            queryBuildDataSource.addDynalink(fieldNum(AgreementLine, Agreement),
                                                                             purchAgreementHeader,
                                                                             fieldNum(PurchAgreementHeader, RecId));
                                            break;

        case tableNum(AgreementLine):       agreementLine = element.args().record();
                                            queryBuildDataSource = this.query().dataSourceTable(tableNum(PurchLine));
                                            queryBuildDataSource.clearRanges();
                                            queryBuildDataSource = queryBuildDataSource.addDataSource(tableNum(AgreementLineReleasedLine));
                                            queryBuildDataSource.joinMode(JoinMode::ExistsJoin);
                                            queryBuildDataSource.addLink(fieldNum(PurchLine, InventTransId),
                                                                         fieldNum(AgreementLineReleasedLine, PurchLineInventTransId));
                                            queryBuildDataSource.clearDynalinks();
                                            queryBuildDataSource.relations(true);
                                            queryBuildDataSource.addDynalink(fieldNum(AgreementLineReleasedLine, AgreementLine),
                                                                             agreementLine,
                                                                             fieldNum(AgreementLine, RecId));
                                            break;
    }

    super();
}

public void init()
{
    QueryBuildRange rangeIsDeleted;

    super();

    switch (element.args().dataset())
    {
        case tableNum(PurchLine),
             tableNum(ProjTable),
             tableNum(ProjWIPTable),

             tableNum(PurchAgreementHeader),
             tableNum(AgreementLine) :
            this.query().dataSourceTable(tableNum(PurchLine)).clearDynalinks();
            break;
    }

    if (traceFilter)
    {
        traceFilter.parmMainDataSource(PurchLine_ds);
        traceFilter.parmFilterDataSource(PurchLineTmpFilter_ds);
        traceFilter.parmPurchTableDataSource(PurchTable_ds);
        traceFilter.parmInventDimDataSource(InventDim_ds);
        traceFilter.parmInventBatchDataSource(InventBatch_ds);
        traceFilter.dataSourceInitPost();
        purchLine_ds.cacheAddMethod(tableMethodStr(PurchTable, editContactPersonName));
        purchLine_ds.cacheAddMethod(tableMethodStr(PurchTable, contactPersonPhone));
    }

    rangeIsDeleted = this.query().dataSourceTable(tableNum(PurchLine)).addRange(fieldNum(PurchLine,IsDeleted));
    rangeIsDeleted.value(SysQuery::value(NoYes::No));
    rangeIsDeleted.status(RangeStatus::Hidden);
}

public Common resolveReference(FormReferenceControl _formReferenceControl)
{
    var intrastatCommodityController = IntrastatCommodityController::newFromItemAndCategory(PurchLine.ItemId, PurchLine.ProcurementCategory);

    return intrastatCommodityController.resolveReference(_formReferenceControl);
}

public Common lookupReference(FormReferenceControl _formReferenceControl)
{
    var intrastatCommodityController = IntrastatCommodityController::newFromItemAndCategory(PurchLine.ItemId, PurchLine.ProcurementCategory);

    return intrastatCommodityController.lookupReference(_formReferenceControl);
}

